const categories = [
  'All',
  'Arrays',
  'Strings',
  'Linked Lists',
  'Trees',
  'Graphs',
  'Dynamic Programming',
  'Math',
  'Sorting'
];
const difficulties = [
  { name: 'Easy', color: 'green' },
  { name: 'Medium', color: 'yellow' },
  { name: 'Hard', color: 'red' }
];

 export default categoriesdifficulties;
